import React, {useState} from 'react';
import Number from "./Number/Number";
import './App.css';

const App = () => {
  const [numbers, setNumbers] = useState({
    number: [5, 11, 16, 23, 32]
  });

  const changeNumbers = () => {
   let array = [];
    for(let i = 0; i < 5; i++) {
      let add = true;
      let randomNumber = Math.floor(Math.random() * 36) + 1;
      for(let y = 0; y < 36; y++) {
        if(array[y] === randomNumber) {
          add = false;
        }
      }
      if(add) {
        numbers.push(randomNumber);
      } else {
        i--;
      }
    }

    var highestNumber = 0;
    for(var m = 0; m < numbers.length; m++) {
      for(var n = m + 1; n < numbers.length; n++) {
        if(numbers[n] < numbers[m]) {
          highestNumber = numbers[m];
          numbers[m] = numbers[n];
          numbers[n] = highestNumber;
        }
      }
    }
   setNumbers({number: array});
  };




  return (
    <div className="App">
      <div onClick={changeNumbers}>
        <button className="change-button">New numbers</button>
      </div>
      <Number number={numbers.number[0]}/>
      <Number number={numbers.number[1]}/>
      <Number number={numbers.number[2]}/>
      <Number number={numbers.number[3]}/>
      <Number number={numbers.number[4]}/>
    </div>
  );
};

export default App;
